import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { AuthProvider } from "./Auth";
import PrivateRoute from "./PrivateRoute";
import LoginStepPhoneEmail from "./pages/Steps/stepPhoneEmail/LoginStepPhoneEmail";
import SignupStepPhoneEmail from "./pages/Steps/stepPhoneEmail/SignupStepPhoneEmail";
import Rooms from "./pages/Rooms/Rooms";
import Phone from "./pages/Steps/stepPhoneEmail/Phone/Phone";
const App = () => {
  return (
    <AuthProvider>
      <Router>
        <div>
          {/* <PrivateRoute exact path="/" component={Rooms} /> */}
          {/* <Route exact path="/login" component={LoginStepPhoneEmail} /> */}
          <Route exact path="/login" component={Phone} />
          {/* <Route exact path="/signup" component={SignupStepPhoneEmail} /> */}

        </div>
      </Router>
    </AuthProvider>
  );
};

export default App;
